import React from "react";

function Content() {
  return (
    <div>
      <h4
        style={{
          textShadow:
            "0 0 2px #fff, 0 0 4px #fff, 0 0 6px #fff, 0 0 8px #fff, 0 0 10px #fff, 0 0 12px #fff, 0 0 14px #fff,0 0 16px #fff,  0 0 18px #fff",
        }}
      >
        {" "}
        MY SKILLS{" "}
      </h4>

      <div>
<h3>Technical Skills</h3>
<ul>
  <li><strong>Programming Languages:</strong>Java, HTML, CSS</li>
  <li><trong>Web Development:</trong>React, Node.js, Express.js</li>
  <li><trong>Databases Management:</trong>SQL, MySQL, MongoDB, Database Normalization</li>
  <li><trong>Agile ProjectManagement:</trong>Trello</li>
  <li><trong>Cloud Hosting:</trong>AWS</li>
  <li><trong>IT Support:</trong>Troubleshooting, HW & SW installation</li>
  <li><trong>Tools & Technologies:</trong>Git, VSCode, Docker</li>
 
</ul>

      </div>
    </div>
  );
}

export default Content;
